import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge, Row, Col, Button, Menu, Icon } from 'antd';
// partials
import Calender from './partials/Calendar';
import DivBar from './partials/DivBar';
// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <DivBar/>
        <Row>
        </Row>
      </div>
    );
  }
}

export default App;
